Here is a basic example of what I have so far:

```jsx
import { createContext, useState } from 'react';

const TooltipContext = createContext();

const TooltipProvider = ({ children }) => {
  const [tooltip, setTooltip] = useState(null);

  const openTooltip = (tooltip) => {
    setTooltip(tooltip);
  };

  const closeTooltip = () => {
    setTooltip(null);
  };

  return (
    <TooltipContext.Provider value={{ tooltip, openTooltip, closeTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};

const Tooltip = () => {
  const { tooltip, openTooltip, closeTooltip } = useContext(TooltipContext);

  const handleMouseOver = () => {
    openTooltip('This is a tooltip');
  };

  const handleMouseOut = () => {
    closeTooltip();
  };

  return (
    <div onMouseOver={handleMouseOver} onMouseOut={handleMouseOut}>
      Hover over me
      {tooltip && <div>{tooltip}</div>}
    </div>
  );
};
```

However, this code doesn't work as expected because the `Tooltip` component is not a direct child of the `TooltipProvider` component. The `Tooltip` component is used in different places in the app, and I don't want to wrap the entire app with the `TooltipProvider` component.

Is there a way to achieve this without wrapping the entire app with the `TooltipProvider` component?

Yes, you can achieve this by using a different approach. Instead of using a context, you can use a singleton pattern to manage the tooltips. Here's an example:

```jsx
import { useState, useEffect } from 'react';

const tooltipManager = {
  tooltip: null,
  openTooltip: (tooltip) => {
    tooltipManager.tooltip = tooltip;
    tooltipManager.listeners.forEach((listener) => listener(tooltip));
  },
  closeTooltip: () => {
    tooltipManager.tooltip = null;
    tooltipManager.listeners.forEach((listener) => listener(null));
  },
  listeners: [],
};

const useTooltip = () => {
  const [tooltip, setTooltip] = useState(null);

  useEffect(() => {
    const listener = (tooltip) => {
      setTooltip(tooltip);
    };
    tooltipManager.listeners.push(listener);
    return () => {
      tooltipManager.listeners = tooltipManager.listeners.filter((l) => l !== listener);
    };
  }, []);

  return { tooltip, openTooltip: tooltipManager.openTooltip, closeTooltip: tooltipManager.closeTooltip };
};

const Tooltip = () => {
  const { tooltip, openTooltip, closeTooltip } = useTooltip();

  const handleMouseOver = () => {
    openTooltip('This is a tooltip');
  };

  const handleMouseOut = () => {
    closeTooltip();
  };

  return (
    <div onMouseOver={handleMouseOver} onMouseOut={handleMouseOut}>
      Hover over me
      {tooltip && <div>{tooltip}</div>}
    </div>
  );
};
```

In this example, we create a singleton object `tooltipManager` that manages the tooltips. We use a `useTooltip` hook to connect to the `tooltipManager` and get the current tooltip and the `openTooltip` and `closeTooltip` functions.

This way, you can use the `Tooltip` component anywhere in your app without wrapping the entire app with a provider component.

