Static variables are variables that are allocated storage only once at compile time, and they retain their values between different function calls. They are initialized only once at compile time. Static variables are used to retain values between function calls. They are not reinitialized upon each function call. Static variables are used to declare variables that are visible only within the file and are shared by all the functions within the file.
Register variables are variables that are stored in one of the CPU's registers, rather than in RAM. They are used to store frequently accessed variables. The register keyword is used to declare register variables. The register keyword is a request to the compiler to store the variable in a register. However, the compiler may choose to ignore this request if it is not possible to store the variable in a register.
Here is an example of static and register variables in C:
```
#include <stdio.h>

void func() {
    static int x = 10; // static variable
    register int y = 20; // register variable

    printf("x = %d\n", x);
    printf("y = %d\n", y);

    x++;
    y++;
}

int main() {
    func();
    func();
    return 0;
}
```
In this example, the variable `x` is a static variable, and it retains its value between function calls. The variable `y` is a register variable, and it is stored in a CPU register.

