### Browser Environment

In a browser environment, you can use the `prompt()` function to get user input. This function displays a dialog box that prompts the user for input.

```typescript
function getUserInput(): void {
    const userInput = prompt("Please enter your name:");
    if (userInput !== null) {
        console.log(`Hello, ${userInput}!`);
    }
}

