```

### Node.js Environment

In a Node.js environment, you can use the `readline` module to get user input from the console.

```typescript
import * as readline from 'readline';

const rl = readline.createInterface({
    input: process.stdin,
    output: process.stdout
});

function getUserInput(): void {
    rl.question('Please enter your name: ', (answer) => {
        console.log(`Hello, ${answer}!`);
        rl.close();
    });
}

getUserInput();
```

